import React,{ Component } from 'react';
import './App.css';
import Logged from './components/Model';
import axios from "axios"
import {
  BrowserRouter as Router,
  Route,
  Link
} from 'react-router-dom'


export default class App extends Component {
  state={
    id:[],
    title:[],
    url:[],
    train_score:[],
    test_score:[],
  }

  getData=()=>{
    axios.get('main/')
    .then(data=>{
      let newState={...this.state}
      data.data.datum.forEach((item)=>{
        newState.id.push(item._id)
        newState.title.push(item.title)
        newState.train_score.push(item.train_acc)
        newState.test_score.push(item.test_acc)
        newState.url.push('http://placehold.it/300x300')
      })

      this.setState(newState)
    })
  }
  render() {
    const info=this.state.title.map((item,index)=>{
      return <Logged url={this.state.url[index]} title={this.state.title[index]} train_score={this.state.train_score[index]} test_score={this.state.test_score[index]} key={index} id={this.state.id[index]} />
    })
    return (
      <div>

      </div>
    )
  }
}
